pragma solidity ^0.8.13;

contract Primitives{
    bool public boo; //bool 是solidity中的逻辑符号（true/false），初始默认值是false

    uint8 public numa = 3; //uint8 是非负整数类型，最大值是 2**8-1；以此类推uint16 的 0 到 2**16-1

